import {
  AsyncSubject,
  combineLatest,
  merge,
  Observable,
  Observer,
  of,
  ReplaySubject,
  Subject,
  from,
  EMPTY,
} from "rxjs";
import {
  distinctUntilChanged,
  distinctUntilKeyChanged,
  filter,
  mergeMap,
  share,
  tap,
  withLatestFrom,
  map,
  reduce,
} from "rxjs/operators";
import find from "../../../../../utils/array_find";
import { concat, strToBytes } from "../../../../../utils/byte_parsing";

import { SegmentConstuctionError } from "../../utils";

import { IParsedRepresentation } from "../../../../../parsers/manifest/types";
import {
  IProgressBarBuilderAbstract,
  IUtils,
  IVideoSettingsQualityInputType,
} from "../../types";
import {
  IDownloadManagerOutput,
  ILocalManifestOnline,
  Quality,
  ISettings,
  IGlobalContext,
  IContextUniq,
  IContext,
} from "./types";
import Manifest, {
  Adaptation,
  Representation,
  ISegment,
} from "../../../../../manifest";
import { IDBPDatabase } from "idb";
import { SegmentPipelinesManager } from "../../../../../core/pipelines";
import { TypedArray } from "../../../../../core/eme";
import { Context } from "vm";
import { createBox } from "../../../../../parsers/containers/isobmff";

/**
 * A tool function to choose quality depending of what we receive
 *
 * @remarks
 * This function, try to define what quality we should use by either:
 * - determining the exact quality we want
 * - determine the quality by telling to get the HIGHEST, MEDIUM or LOWEST quality
 *
 * @param IParsedRepresentation[] - The representation video of the current
 * parsed dash content
 * @param currentTypeAdaptation - The current type of the adapation we are currently on.
 * @param quality - The quality we want to choose, either a exact number or
 * HIGH,MEDIUM,LOW
 * @returns The representation that correspond to the quality wanted
 *
 */
export const chooseVideoQuality = (
  representations: IParsedRepresentation[],
  currentTypeAdaptation: string,
  quality: [number, number] | IVideoSettingsQualityInputType,
): IParsedRepresentation[] => {
  if (currentTypeAdaptation !== "video") {
    return representations;
  }

  if (!representations || representations.length === 0) {
    throw new SegmentConstuctionError("No representations video found");
  }

  if (Array.isArray(quality)) {
    const [widthWanted, heightWanted] = quality;
    const reprensentationQuality = find(
      representations,
      ({ width, height }) => width === widthWanted && height === heightWanted,
    );
    if (reprensentationQuality) {
      return [reprensentationQuality];
    }
  }

  const sortedRepresentationsByDESC = representations.sort(
    (a: IParsedRepresentation, b: IParsedRepresentation) =>
      b.height && a.height ? b.height - a.height : 0,
  );
  switch (quality) {
    case Quality.HIGH:
      return [sortedRepresentationsByDESC[0]];
    case Quality.MEDIUM:
      return [
        sortedRepresentationsByDESC[
          Math.floor(sortedRepresentationsByDESC.length / 2)
        ],
      ];
    case Quality.LOW:
      return [
        sortedRepresentationsByDESC[sortedRepresentationsByDESC.length - 1],
      ];
    default:
      return [
        sortedRepresentationsByDESC[
          Math.floor(sortedRepresentationsByDESC.length / 2)
        ],
      ];
  }
};

/**
 * An operator that take a Observable in parameter that
 * is emitting a progress status. Then, decide when to emit next manifest.
 *
 * @param progress$ - An Observable under the form ProgressBarBuilder type
 * @returns - An Observable
 *
 */
export function emitEveryNth(
  progress$: ReplaySubject<IProgressBarBuilderAbstract>,
  utilsBuilder: IUtils,
  contentID: string,
  pause$: AsyncSubject<void>,
) {
  return (
    source$: Observable<ILocalManifestOnline>,
  ): Observable<IDownloadManagerOutput> => {
    const { storeManifestEvery, emitter } = utilsBuilder;
    return new Observable((obs: Observer<IDownloadManagerOutput>) => {
      const progressFiltered$ = progress$.pipe(
        mergeMap(({ progress, ...props }) =>
          of({
            progress:
              progress > 98 && progress < 100 ? progress : Math.round(progress),
            ...props,
          }),
        ),
        distinctUntilKeyChanged("progress"),
      );
      const builder$ = combineLatest([source$, progressFiltered$]).pipe(
        distinctUntilChanged(
          ([_, { progress: prevProgress }], [__, { progress: currProgress }]) =>
            prevProgress === currProgress,
        ),
        tap(builder => {
          const [, { status, progress, size }] = builder;
          emitter.trigger("progress", {
            contentID,
            progress,
            size,
            status,
          });
        }),
        share(),
      );
      merge(
        builder$.pipe(
          filter(([_, { progress }]) =>
            storeManifestEvery && typeof storeManifestEvery === "function"
              ? storeManifestEvery(progress) || progress === 100
              : progress % 10 === 0,
          ),
        ),
        pause$,
      )
        .pipe(withLatestFrom(builder$))
        .subscribe(
          ([_, [manifest, { progress, status, ...props }]]) => {
            obs.next({
              manifest: { ...manifest, isFinished: progress === 100 },
              progress:
                (props.progressBarBuilder.progress /
                  props.progressBarBuilder.overall) *
                100,
              ...props,
            });
          },
          err => obs.error(err),
          () => obs.complete(),
        );
    });
  };
}

function decideVideoContext(
  videoAdaptations: Adaptation[],
  settings: ISettings,
): {
  adaptation: Adaptation;
  representation: Representation;
  segment: ISegment;
}[] {
  return videoAdaptations.reduce((acc: IContextUniq[], curr) => {
    const representation = curr.representations.sort((a, b) =>
      b.height && a.height ? b.height - a.height : 0,
    )[curr.representations.length - 1];
    const segment = representation.index.getInitSegment();
    if (!segment) {
      throw new Error("Error while constructing the init segment");
    }
    acc.push({
      adaptation: curr,
      representation,
      segment,
    });
    return acc;
  }, []);
}

function decideAudioContext(
  audioAdaptations: Adaptation[],
  settings: ISettings,
): {
  adaptation: Adaptation;
  representation: Representation;
  segment: ISegment;
}[] {
  return audioAdaptations.reduce((acc: IContextUniq[], curr) => {
    const adaptation = curr;
    const representation = curr.representations[0];
    const segment = representation.index.getInitSegment();
    if (!segment) {
      throw new Error("Error while constructing the init segment");
    }
    acc.push({
      adaptation,
      representation,
      segment,
    });
    return acc;
  }, []);
}

function decideTextContext(
  textAdaptations: Adaptation[],
  settings: ISettings,
): {
  adaptation: Adaptation;
  representation: Representation;
  segment: ISegment;
}[] {
  return textAdaptations.reduce((acc: IContextUniq[], curr) => {
    const adaptation = curr;
    const representation = curr.representations[0];
    const segment = representation.index.getInitSegment();
    if (!segment) {
      throw new Error("Error while constructing the init segment");
    }
    acc.push({
      adaptation,
      representation,
      segment,
    });
    return acc;
  }, []);
}

export function getContextsFormatted(
  globalCtx: IGlobalContext,
): { video: IContext[]; audio: IContext[]; text: IContext[] } {
  const video = globalCtx.video.reduce(
    (_: IContext[], currVideo): IContext[] => {
      return currVideo.contexts.map(
        (videoContext): IContext => ({
          manifest: globalCtx.manifest,
          period: currVideo.period,
          ...videoContext,
        }),
      );
    },
    [],
  );
  const audio = globalCtx.audio.reduce(
    (_: IContext[], currAudio): IContext[] => {
      return currAudio.contexts.map(
        (audioContext): IContext => ({
          manifest: globalCtx.manifest,
          period: currAudio.period,
          ...audioContext,
        }),
      );
    },
    [],
  );
  const text = globalCtx.text.reduce((_: IContext[], currText): IContext[] => {
    return currText.contexts.map(
      (textContext): IContext => ({
        manifest: globalCtx.manifest,
        period: currText.period,
        ...textContext,
      }),
    );
  }, []);
  return { video, audio, text };
}

export function handleSegmentPipelineFromContexts<
  KeyContextType extends keyof Omit<IGlobalContext, "manifest">
>(
  ctxs: IContext[],
  contentType: KeyContextType,
  {
    segmentPipelinesManager,
    isInitData,
    db,
    contentID,
  }: {
    contentID: string;
    db: IDBPDatabase;
    isInitData: boolean;
    segmentPipelinesManager: SegmentPipelinesManager<any>;
  },
): Observable<{
  chunkData: Uint8Array;
  duration: number;
  ctx: IContext;
  index: number;
}> {
  const segmentFetcherForCurrentContentType = segmentPipelinesManager.createPipeline(
    contentType,
    new Subject(),
  );
  return from(ctxs).pipe(
    mergeMap(
      (ctx, index) =>
        segmentFetcherForCurrentContentType.createRequest(ctx).pipe(
          mergeMap(evt => {
            switch (evt.type) {
              case "chunk-complete":
                return EMPTY;
              case "chunk":
                return evt.parse();
              default:
                return EMPTY;
            }
          }),
          reduce(
            (acc, { chunkData, chunkInfos }) => {
              if (chunkData === null) {
                return acc;
              }
              const durationForCurrentChunk =
                chunkInfos !== null && chunkInfos.duration != undefined
                  ? chunkInfos.duration + acc.duration
                  : acc.duration;
              if (
                contentType === "text" &&
                ctx.representation.mimeType &&
                ctx.representation.mimeType === "application/mp4"
              ) {
                return {
                  chunkData: concat(
                    createBox("moof", acc.chunkData),
                    createBox("moof", strToBytes(chunkData.data)),
                  ),
                  duration: durationForCurrentChunk,
                };
              }
              return {
                chunkData: concat(acc.chunkData, chunkData),
                duration: durationForCurrentChunk,
              };
            },
            { chunkData: new Uint8Array(0), duration: 0 },
          ),
          map(infoData => ({ ...infoData, ctx, index })),
          tap(({ chunkData, duration, ctx }) =>
            db.put("segments", {
              contentID,
              data: chunkData,
              duration,
              segmentKey: `${ctx.representation.id}--${contentID}--${
                isInitData ? "init" : index
              }`,
              size: chunkData.byteLength,
            }),
          ),
        ),
      3,
    ),
  );
}

export function getContextForCurrentSession(
  manifest: Manifest,
  settings: ISettings,
): IGlobalContext {
  return manifest.periods.reduce(
    (acc: IGlobalContext, period) => {
      const videoContexts = decideVideoContext(
        period.getAdaptationsForType("video"),
        settings,
      );
      acc.video.push({ period, contexts: videoContexts });

      const audioContexts = decideAudioContext(
        period.getAdaptationsForType("audio"),
        settings,
      );
      acc.audio.push({ period, contexts: audioContexts });

      const textContexts = decideTextContext(
        period.getAdaptationsForType("text"),
        settings,
      );
      acc.text.push({ period, contexts: textContexts });

      return acc;
    },
    { video: [], audio: [], text: [], manifest },
  );
}
